r\n\r\n<p>&nbsp;</p>',NULL,'2022-04-18 05:53:07'),(10,'Zoom Meeting','Zoom Meeting','<p>Hi {{patient_name}},</p>\r\n\r\n<p>{{doctor_name}} has created a zoom meeting. if you want to join the meeting, please click here</p>\r\n\r\n<p>Meeting Schedule:&nbsp;{{meeting_schedule}}</p>',NULL,'2022-04-19 07:00:26');
